import React from 'react';
// import blank from './Images/blank.png';
// import blanktall from './Images/blank-tall.png';
import './photoshop-content.css';

export class PhotoshopContent extends React.Component {

    constructor() {
        super();
        this.state = {
            //js: undefined,
            divtest: undefined
        }
    }

    getPhotos () {
        fetch('http://localhost:4200/api/photoshops/', {
            method: 'get'
        }).then(res =>
            res.json().then(json => {
                //this.setState({ js: json});
                var jsonFinal = "";
                for(var i = 0; i < json.length; i++) {
                    jsonFinal += "<img className='img' src='" + json[i].ImageUrl + "' title='" + json[i].Title + "'/>";
                }
                console.log(jsonFinal);
                this.setState({ divtest: jsonFinal });
                // return (
                //     json
                //     // <div>
                //     //     {json[0]}
                //     // </div>
                // );
            })
        );
    }

    componentDidMount () {
        this.getPhotos();
    }

    render () {
        const { js } = this.state;
        return (
            <div className="photoshop-content">
                <br></br>
                <br></br>
                <h1>Restoration, Colorization, Manipulation</h1>
                <h2>7 Years of Photoshop Experience</h2>
                
                <div className="column">
                    {/* <img src={blank}/>
                    <img src={blanktall}/>
                    <img src={blank}/>
                    <img src={blank}/> */}
                </div>

                <div className="column">
                    {/* <img src={blanktall}/>
                    <img src={blank}/>
                    <img src={blanktall}/>
                    <img src={blank}/> */}
                </div>

                <div className="column">
                    {/* <img src={blanktall}/>
                    <img src={blank}/>
                    <img src={blank}/>
                    <img src={blanktall}/> */}
                </div>

                <div className="content">
                    {js && this.state.divtest}
                    {/* {js && this.state.js[0].Title} */}
                    {/* {js && this.state.js.map((object, i) => <ObjectRow obj={object} key={i} />)} */}
                </div>

                <div className="clear"/>
            </div>
        );
    }
};
